import React from "react";

function Dashboard() {
  return (
    <div className="booking-container">
      <h1>Dashboard</h1>
      <p>Karibu kwenye Online Ticket Booking System</p>

      <a href="/seats">
        <button className="book-button">
          Book Ticket
        </button>
      </a>
    </div>
  );
}

export default Dashboard;
